  \"Quarterly Narrative Report for May, June and July 1938: Lower Souris Migratory
  Waterfowl Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:21:47.029533\",\n\t\"name\": \"quarterly-narrative-report-for-may-june-and-july-1938-lower-souris-migratory-waterfowl-ref\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge in May, June and July of 1938. The drought seems
  to be over; rainfall over the summer was generous. The units are generally full
  and there are prospects for a better crop this year. The nesting season at the refuge
  was a success and there was an overall increase of ducklings. The upland game birds
  are having a great year with lots of large broods. Banding continued, though not
  to the extent as desired.  Predator and rodent control efforts are still a major
  management priority in an effort to keep predation on nests low. Deer and Beaver
  species have increased by one hundred percent since the refuge was established in
  1935. Other projects included the refuge nursery, the lookout tower, plantings,
  seed collection and cultivated crops. The report concludes with a photographs section.\",\n\t\"license_title\":
